import React, { Component } from 'react';
import { BrowserRouter as Router } from 'react-router-dom';
import { Switch, Route } from 'react-router-dom';
import Root from './calendar-components/containers/Root'
import { createStore, applyMiddleware, compose } from 'redux';
import eventsReducer from './calendar-components/reducers/events.es6';
import { apiMiddleware } from './calendar-containers/middlewares/apiMiddleware';
import { loggerMiddleware } from './calendar-containers/middlewares/loggerMiddleware';
import { createHashHistory } from 'history';

class View extends Component {
  render() {
    const composeEnhancers = window.__REDUX_DEVTOOLS_EXTENSION_COMPOSE__ || compose;
    const store = createStore(eventsReducer, composeEnhancers(applyMiddleware(apiMiddleware, loggerMiddleware)));
    const history = createHashHistory();
    return (
      <div className="App">
        <Root store={store} history={history} />
      </div>
    );
  }
}

export default View;
